To resize the iframe based on the content of the embed source link, you can listen for the "load" event on the iframe and then set the iframe's width and height to the size of the content. Here's an example of how you can modify the portion of the userscript to do this:
```javascript
// Create the iframe embed code
const embedUrl = `${href}/embed`;
const scriptSrc = `https://${domain}/embed.js`;
const iframe = document.createElement("iframe");
iframe.src = embedUrl;
iframe.classList.add("mastodon-embed");
iframe.style.maxWidth = '550px';
iframe.style.border = "0";
iframe.style.width = '100%';
iframe.style.height = '400px';
iframe.setAttribute("allowfullscreen", "allowfullscreen");
const script = document.createElement("script");
script.src = scriptSrc;
script.async = true;
iframe.appendChild(script);

// Listen for the "load" event on the iframe
iframe.addEventListener("load", () => {
  // Get the width and height of the content inside the iframe
  const iframeContentWidth = iframe.contentWindow.document.body.offsetWidth;
  const iframeContentHeight = iframe.contentWindow.document.body.offsetHeight;

  // Set the width and height of the iframe to the size of the content
  iframe.width = iframeContentWidth;
  iframe.height = iframeContentHeight;
});
```
This code listens for the "load" event on the iframe, which is fired when the content inside the iframe has finished loading. When this event is fired, the code gets the width and height of the content inside the iframe using the `offsetWidth` and `offsetHeight` properties of the `body` element, and then sets the width and height of the iframe to those values. This will ensure that the iframe is the same size as the content inside it, without any extra padding or scrolling.

