En JavaScript, puedes convertir una cadena de texto a minúsculas usando el método `toLowerCase()`. Aquí hay un ejemplo:
```javascript
let string = "Mi cadena de texto en capitales";
let lowercaseString = string.toLowerCase();
console.log(lowercaseString); // Imprime "mi cadena de texto en minúsculas"
```
Si quieres convertir una cadena de texto a mayúsculas, puedes usar el método `toUpperCase()`.
```javascript
let string = "mi cadena de texto en minúsculas";
let uppercaseString = string.toUpperCase();
console.log(uppercaseString); // Imprime "MI CADENA DE TEXTO EN MAYÚSCULAS"
```
También puedes usar la función `str.toLowerCase()`, que es una función de JavaScript que convierte una cadena de texto en minúsculas.
```javascript
let string = "Mi cadena de texto en capitales";
let lowercaseString = string.toLowerCase();
console.log(lowercaseString); // Imprime "mi cadena de texto en minúsculas"
```
